import React, { useState } from 'react'

const Task = (props) => {
  const [completed, setComplete] = useState(false)
  return (
    <div>
      <ul>
        <li>
          {props.taskName}
          <form action="" className="d-flex">
            <label htmlFor="done"></label>
            <input type="checkbox" name="done" id="done" checked={completed} />
          </form>
        </li>
      </ul>
    </div>
  )
}

export default Task
